import React from "react";
import styled from 'styled-components';
import AppHeader from "../../components/AppHeader";

const CategoryBox = styled.div`
    border: 1px solid gray;
    display: flex;
    position: relative; 

    /* Define a pseudo-element for additional styling */
    div::before {
        content: "ㅣ"; /* Add content to create a pseudo-element */
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        /* Add any other styles you want for the pseudo-element */
    }
`;

const LeftButton = styled.button`
    padding-top: 3px;
    margin-right: 15.5px;
    font-size: 24px;
    line-height: 29px;
    font-weight: 700;
    color: #333
`;

const Employment = () => {
    return (
        <>
            <AppHeader />
            <CategoryBox>
                <LeftButton>전체</LeftButton>
                <div>직군을 선택해주세요.</div>
            </CategoryBox>
        </>
    );
}

export default Employment;
